void RogueProgram::launch( int argc, char* argv[] )
{
  RogueSystem__init_class();
  RogueTokenType__init_class();
  RoguePreprocessor__init_class();

  RogueClassSystem::executable_filepath = RogueString::create( argv[0] );
  for (int i=1; i<argc; ++i)
  {
    RogueStringList__add( RogueClassSystem::command_line_arguments, RogueString::create( argv[i] ) );
  }

  Rogue_program.main_object = Rogue_program.type_RogueC->singleton();
  Rogue_program.collect_garbage();
}

void RogueProgram::finish_tasks()
{
  while (RogueTaskManager__update(Rogue_program.type_TaskManager->singleton()))
  {
    Rogue_program.collect_garbage();
  }
}
